import {Box, Button, makeStyles, TextField} from "@material-ui/core"
import {OnlyOwner} from "../hooks/hookAdmin"
import {EnterLottery} from "../hooks/hookMain"

export const Admin = () => {

    const hook = OnlyOwner()
    const hook2 = EnterLottery()

    const fja = () => {
        hook2.getBalance()
    }

    return (
        <>
            <Button onClick={fja}>DUGME</Button>
            <div>STATE</div>
            <div>GETBALANCE</div>
            <div>START LOTTERY</div>
            <div>ENTER LOTTERY</div>
            <div>END LOTTERY</div>
        </>
    )
}
